import React from "react";
import classes from "./Container.module.css";

import ItemList from "./listComponents/ItemsList";
import Form from "./formComponents/Form";

const Container = (props) => {
  const arr = [
    { id: 0, name: "Test", date: "TestDate" },
    { id: 1, name: "Test", date: "TestDate" },
    { id: 2, name: "Test", date: "TestDate" },
    { id: 3, name: "Test", date: "TestDate" },
  ];

  return (
    <div className={classes.container}>
      {props.mode === "list" && <ItemList items={arr} />}
      {props.mode === "form" && <Form />}
    </div>
  );
};

export default Container;
